    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [email, setEmail] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');

    function handleSignUp(e) {
        e.preventDefault();
        const user = {username, password, email, phoneNumber}
        console.log(user);
    }



    return (
        <div>
            <form action="#" method="post" onSubmit="return showConsentAlert();">
                <div>
                    <h1>Signup</h1>
                    <input type="text" name="uname" placeholder="User name" required autoFocus/>
                    <input type="password" name="password" placeholder="Password" required/>
                    <input type="email" name="email" placeholder="Email" required/>
                    <input type="tel" name="phone" placeholder="123-456-7890" pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}" required/>
                    <input id="registerButton" type="submit" value="Register" onClick={handleSignUp}/>
                    <p>Already have an account? </p><Link to="/main">Login</Link>
                </div>
            </form>
        </div>
    );
};

export default RegisterPage;
